#include "MainWindow.h"
#include "Game.h"

bool Poo::drawFinished = false;
Game::Game(MainWindow& wnd)
	:
	poos(10),
	wnd(wnd),
	gfx(wnd),
	rng(rd()),
	xDist(0, 770),
	yDist(0, 570)

{
}

void Game::Go()
{
	gfx.BeginFrame();
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::UpdateModel()
{
	if (!difficultySelected) {
		
		if (wnd.kbd.KeyIsPressed(VK_UP)) {
			normalColor = true;
			hardColor = false;
		}
		if (wnd.kbd.KeyIsPressed(VK_DOWN)) {
			normalColor = false;
			hardColor = true;
		}
		if (wnd.kbd.KeyIsPressed(VK_RETURN)) {
			if (normalColor) {
				difficulty = 0;
			}
			if (hardColor) {
				difficulty = 1;
			}
			difficultySelected = true;
			instructionDrawn = false;
			enterPressed = true;
		}
		drawNormal(gfx, normalColor);
		drawHard(gfx, hardColor);
	}
	// Draw instructions at first of game;
	if (!instructionDrawn) {

		DrawInstructions(263, 209);
		if (wnd.kbd.KeyIsPressed(VK_RETURN)) {
			if (enterPressed) {}
			else {
				isStarted = true;
				isFinished = true;
				level++;
				isStarted = false;
				instructionDrawn = true;
				enterPressed = true;
			}
		}
		else {
			enterPressed = false;
		}
	}

	if (isFinished)
	{
		if (wnd.kbd.KeyIsPressed(VK_RETURN)) {
			isStarted = false;
			Poo::setDrawFinished(false);
			isFinished = false;
			enterPressed = true;
			if (gameOver) {
				instructionDrawn = false;
				gameOver = false;
			}
		}
	}
	if (isStarted)
	{
		// update / clamp dude on screen
		dude.Update(wnd.kbd);
		dude.ClampToScreen();
		// Processes dude collision and updates poo
		for (int i = 0; i < poos.size(); i++) {
			if (poos[i].ProcessCollision(dude)) {
				if (difficulty = 1) {
					level = 1;
				}
				isFinished = true;
				Poo::setDrawFinished(true);
				for (int j = 0; j < poos.size(); j++) {
					poos[j].StopPoo();
				}
			}

			poos[i].Update();
		}
		box.ProcessCollision(dude);
	}
	else {
		if (wnd.kbd.KeyIsPressed(VK_RETURN))
		{
			if (enterPressed) {}
			else {
				for (int i = 0; i < poos.size(); i++) {
					poos[i].setIsEaten(false);
				}


				levAdd = false;
				box.RandPos();
				isStarted = true;
				box.setScore(0);

			}
		}
		else {
			enterPressed = false;
		}

	}


}


